    body {
        margin: 0;
        padding: 0;
    }
    .color-scale {
        position: absolute;
        bottom: 10px;
        left: 10px;
        background: white;
        padding: 10px;
        border-radius: 5px;
        box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
        z-index: 1000; /* Ensure the color scale is on top */
    }
    .color-scale div {
        display: flex;
        align-items: center;
        margin-bottom: 5px;
    }
    .color-scale div:last-child {
        margin-bottom: 0;
    }
    .color-box {
        width: 20px;
        height: 20px;
        margin-right: 10px;
    }
</style>

</div>
